#
# TABLE STRUCTURE FOR: Account
#
drop database if exists `shopese-spring`;
create database `shopese-spring`;
use `shopese-spring`;


DROP TABLE IF EXISTS `Account`;

CREATE TABLE `Account` (
  `accountID` varchar(100) CHARACTER SET utf8 NOT NULL,
  `email` varchar(100) CHARACTER SET utf8 DEFAULT NULL,
  `display` varchar(100) CHARACTER SET utf8 DEFAULT NULL,
  `password` varchar(100) CHARACTER SET utf8 DEFAULT NULL,
  `role` enum('ADMIN','STAFF','USER') COLLATE utf8_unicode_ci DEFAULT NULL,
  `avatar` varchar(100) CHARACTER SET utf8 DEFAULT NULL,
  `deleted` tinyint(4) DEFAULT 0,
  `create_at` timestamp NOT NULL DEFAULT current_timestamp(),
  `update_at` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`accountID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: Product
#

DROP TABLE IF EXISTS `Product`;

CREATE TABLE `Product` (
  `productID` varchar(100) CHARACTER SET utf8 NOT NULL,
  `display` varchar(100) CHARACTER SET utf8 DEFAULT NULL,
  `priceIn` int(11) DEFAULT NULL,
  `priceOut` int(11) DEFAULT NULL,
  `priceSale` int(11) DEFAULT NULL,
  `amount` int(11) DEFAULT NULL,
  `shipday` int(11) DEFAULT NULL,
  `description` varchar(100) CHARACTER SET utf8 DEFAULT NULL,
  `images` varchar(100) CHARACTER SET utf8 DEFAULT NULL,
  `deleted` tinyint(4) DEFAULT 0,
  `create_at` timestamp NOT NULL DEFAULT current_timestamp(),
  `update_at` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`productID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: Receipt
#

DROP TABLE IF EXISTS `Receipt`;

CREATE TABLE `Receipt` (
  `saleID` varchar(100) CHARACTER SET utf8 NOT NULL,
  `productID` varchar(100) CHARACTER SET utf8 DEFAULT NULL,
  `accountID` varchar(100) CHARACTER SET utf8 DEFAULT NULL,
  `price` int(11) DEFAULT NULL,
  `status` varchar(100) CHARACTER SET utf8 DEFAULT NULL,
  `deleted` tinyint(4) DEFAULT 0,
  `create_at` timestamp NOT NULL DEFAULT current_timestamp(),
  `update_at` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`saleID`),
  KEY `productID` (`productID`),
  KEY `accountID` (`accountID`),
  CONSTRAINT `Receipt_ibfk_1` FOREIGN KEY (`productID`) REFERENCES `Product` (`productID`),
  CONSTRAINT `Receipt_ibfk_2` FOREIGN KEY (`accountID`) REFERENCES `Account` (`accountID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



